const iconSizeClass = {
  xs: "w-6 h-6 flex-shrink-0",
  small: "w-8 h-8 flex-shrink-0",
  medium: "w-12 h-12 flex-shrink-0",
  large: "w-14 h-14 flex-shrink-0",
  xl: "w-16 h-16 flex-shrink-0",
  xxl: "w-24 h-24 flex-shrink-0",
  xxxl: "w-40 h-40 flex-shrink-0",
  custom: "",
};

export const Icon = ({
  data,
  className = "",
  tinaField = "",
}) => {
  if (IconOptions[data.name] === null || IconOptions[data.name] === undefined) {
    return null;
  }
  const Style = {
    fill : data.color,
    color : data.color
  }
  const { name, size = "xxxl", style = "regular" } = data;


  const IconSVG = IconOptions[name];

  const iconSizeClasses =
    typeof size === "string"
      ? iconSizeClass[size]
      : iconSizeClass[Object.keys(iconSizeClass)[size]];


return (
    <div
    data-tina-field={tinaField}
    className={`inline-flex relative z-10 flex-shrink-0 justify-center items-center rounded-full ${iconSizeClasses} ${className}`}
    style={Style}
    >
    <IconSVG className="w-2/3 h-2/3" style={Style}/>
    </div>
);
};

